import React from "react";
import {
  Nav,
  Navbar,
  Button,
  NavDropdown,
  Form,
  FormControl,
} from "react-bootstrap";

export default function SectionBar() {
  return (
    <Navbar bg="light" expand="lg">
      <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#link">Link</Nav.Link>
      </Nav>

    </Navbar>
  );
}
